  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The Affordable Care Act requires health
  insurance issuers to submit data on the proportion of premium revenues spent on
  clinical services and quality improvement, also known as the Medical Loss Ratio
  (MLR). It also requires them to issue rebates to enrollees if this percentage does
  not meet minimum standards. MLR requires insurance companies to spend at least 80
  percent or 85 percent of premium dollars on medical care, with the review provisions
  imposing tighter limits on health insurance rate increases. If they fail to meet
  these standards, the insurance companies will be required to provide a rebate to
  their customers starting in 2012.</p>n\",\n\t\"license_title\": \"Other License
